import React, { Component } from 'react';
import Buttons from './Buttons.js';
import './App.css';

class App extends Component {
  render() {
    return (
      <React.Fragment>
        <div className='main'>
          <Buttons />
        </div>
      </React.Fragment>
    );
  }
}


export default App;
